// src/components/ElementList.js

import React, { useEffect, useState } from 'react';

const API_KEY = "13d161b0";

const ElementList = () => {
  const [elements, setElements] = useState([]);

  useEffect(() => {
    fetch('https://api.mockaroo.com/api/your-api-endpoint-here', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
        'X-API-Key': API_KEY, // Incluir la API Key en la cabecera
      },
    })
      .then((response) => response.json())
      .then((data) => {
        setElements(data); // Almacenar los elementos en el estado
      })
      .catch((error) => {
        console.error('Error al obtener datos del API', error);
      });
  }, []);

  return (
    <div>
      <h1>Elementos del API de Mockaroo</h1>
      <ul>
        {elements.map((element, index) => (
          <li key={index}>{element.email}</li>
        ))}
      </ul>
    </div>
  );
};

export default ElementList;
